var facilityDetailsPage={initialize:function(){facilityDetailsPage.attachEvents()},attachEvents:function(){facilityDetailsPage.createFollowUnfollowSymbol();facilityDetailsPage.createDatatable();facilityDetailsPage.moveToTop();facilityDetailsPage.setFacilityFollowUnfollow()},createFollowUnfollowSymbol:function(){$(".i-checks").iCheck({checkboxClass:"icheckbox_square-star",radioClass:"iradio_square-star"})},createDatatable:function(){var n=$("#facilityDetailsListTableId").DataTable({bPaginate:!1,bInfo:!1,columnDefs:[{targets:[0],visible:!1,searchable:!1},{targets:[3],visible:!1,searchable:!1},{render:function(n,t,i){return n+" ("+i[3]+")"},targets:0},]})},moveToTop:function(){$("#moveTop").on("click",function(){$("body").scrollTop(0)})},setFacilityFollowUnfollow:function(){$(".iCheck-helper").click(function(){var n=$("#followCheckDiv").find("div").hasClass("checked");$("#processing-modal").modal("show");$.ajax({type:"GET",dataType:"text",url:"/FacilityLineReport/Follow",data:{isFollow:n},cache:!1,success:function(){$("#processing-modal").modal("hide")},error:function(){$("#processing-modal").modal("hide")}})})}};